import React from 'react';
import ReactDOM from 'react-dom/client'; // Para React 18
import './index.css'; // Arquivo de estilos, se houver
import LoginPage from './LoginPage'; // Importando a página de login

// Criando e renderizando o componente principal
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <LoginPage />
  </React.StrictMode>
);
